import React from 'react';
import styled from "styled-components";

function Login() {
  return (
    <Container>
    <Nav_logo
        src="/images/mouse-clicker.png"
        alt="netflix_logo"/>
    <Login_Container><Login2>Login</Login2></Login_Container>    
    </Container>
  )
}

const Container=styled.main`
    height: 100%;
    position:relative;
    overflow:hidden;
    background: url("/images/valoImg.jpg") center no-repeat;
        background-size: cover;
        content:"";
        position: absolute;
        top:0;
        left:0;
        right:0;
        bottom:0;
        z-index:-1;
`

const Nav_logo=styled.img`
    position: fixed;
    top:10px;
    left: 20px;
    width: 70px;
    object-fit: contain;
`

const Login2=styled.a`
   background-color: rgba(0,0,0,0.6);
   padding: 8px 16px;
   text-transform: uppercase;
   letter-spacing:1.8px;
   border: 1px solid #f9f9f9;
   border-radius:4px;
   transition: all 250ms ease 0s;
   cursor:pointer;

   &:hover{
       background-color:#f9f9f9;
       color:#000;
       border-color:transparent;
   }
`

const Login_Container=styled.div`
    flex: 1;
    display:flex;
    justify-content: flex-end;
`



export default Login
